import React from 'react';
import {Container, Grid, Paper, Typography} from "@material-ui/core";
import {createMuiTheme, makeStyles} from '@material-ui/core/styles';
import './Product.scss';

const theme = createMuiTheme({
    palette: {
        primary: {
            light: '#5ee279',
            main: '#1aaf4b',
            dark: '#007e1d',
            contrastText: '#444',
        },
        secondary: {
            main: '#1bb14c',
        },
    },

});
const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1
    },
    productWrap:{
        height: 'auto'
    },
    heroArea:{
        minHeight: '600px'
    },
    productsArea:{
        backgroundColor: '#2F4858',
        height: 400,
        paddingTop: '50px'
    },
    infoArea:{
        height: 400,
        backgroundColor: '#F7F7F7'
    },
    paysArea:{
        height: 400
    }

}));


export default function Product() {
    const classes = useStyles();

    return (
        <div className={classes.productWrap}>
            <div className={classes.heroArea}>
                <Container >
                    <Typography variant="h5" align="center">DV Bank ONLINE <br/>Checking Accounts</Typography>
                </Container>
            </div>
            <div className={classes.productsArea}>
                <Container>

                </Container>
            </div>
            <div className={classes.infoArea}>
                <Container>

                    <Grid container spacing={3}>
                        <Grid item xs>
                            <Paper>xs</Paper>
                        </Grid>
                        <Grid item xs>
                            <Paper>xs</Paper>
                        </Grid>
                        <Grid item xs>
                            <Paper>xs</Paper>
                        </Grid>
                    </Grid>
                </Container>
            </div>
            <div className={classes.paysArea}>
                <Container>

                </Container>
            </div>
        </div>
    );
}
